import React from 'react';
import { Card, CardActions, CardContent, CardMedia, Button, Typography, Grid } from '@material-ui/core';
import FacoriteBorderIcon from '@mui/icons-material/FavoriteBorder';

import useStyles from './styles';

const Movie = ({ movie }) => {
    const classes = useStyles();

    return (
        <Card className={classes.card}>
            <CardMedia className={classes.media} image={movie.posterurl} title={movie.title} />
            <div className={classes.overlay}>
                <Typography variant="h4">{movie.title}</Typography>
                <Grid item xs="12" sm="6">
                    <Grid>
                        <Typography variant="h6" justify-content>{movie.year}</Typography>
                    </Grid>
                    <Grid>
                        <Typography variant="h6">Rating: {movie.averageRating}</Typography> 
                    </Grid>   
                </Grid>
            </div>
            {/* <div className={classes.details}>
            </div> */}
            {/* <CardContent>
                <Typography className="classes.title" variant="h5" gutterBottom>{movie.year}</Typography>
            </CardContent> */}
        </Card>
    );
}

export default Movie;
